void HAL_TIM_PeriodElapsedCallback(TIM_HandleTypeDef *htim)
{
	static uint32_t counter = 0;
	if (counter < SOUND_LEN)
	{
		PWM_TIMER_HTIM.Instance->CCR4 = sound[counter];
		counter += 1;
	}
	else
	{
		counter = 0;
	}
}

